import React from 'react'
import banda from '/home/jim/my personals as a beginer/luanda react/luanda-kotieno/src/components/images/beach.jpg';

function FishBanda() {
  return (
    <div><h1>FishBanda</h1>
      <p>The is the soul of the small center since the main economic activity in the area is Fishing and fish Farming</p>
         <p>If you may be interested in Nailpach a big sized one you can get any size of your desire in the Fishbanda </p>
         <p>The Fishbanda is headed and controled by the beach Chairman and his Assistant 
         <p><img src={banda} alt="mill" title="" /></p>
      </p>
    </div>
  )
}

export default FishBanda;
